import * as React from 'react';
import styled from 'styled-components';

import { colors } from '../../theme/theme';

export const Container = styled.div`
  border: 2px solid ${colors.gray};
  background-color: ${colors.primary};
  display: flex;
  height: 42px;
  position: relative;
`;
